description:
In the opening of The Virgin Forest, a soporific voice-over narration accompanies a seemingly endless montage of pastoral scenes: mountains, woods, babbling brooks, and so on. In the midst of jokes, anecdotes, and adages, the narrator promises &quot;unexpected pleasures and adventures.&quot;

